  false,\n\t\"url\": null,\n\t\"notes\": \"The data acquisition occurred in 7 missions
  between March 31 and April 5, 2007 in Kent and New Castle Counties, Delaware. The
  data have been classified and were flown to derive bare earth contours at 2 feet.
